import React, { Component } from 'react';
import HeaderAfterLogin from '../../../components/user/HeaderAfterLogin'
import { MDBContainer, MDBEdgeHeader } from "mdbreact";

class Cart extends Component {
    render() {
        return (
            <div>
                <MDBContainer >
                <MDBEdgeHeader></MDBEdgeHeader>
                <HeaderAfterLogin/>
                    
                </MDBContainer>
            </div>
        );
    }
}

export default Cart;
